import React from 'react';
import styled from 'styled-components'; 
import { motion } from "framer-motion";

const StyledVehicleImg = styled.img`
  .vehicle-img {
    animation: opac 0.8s;
  }
`;

function VehicleImg({ className, id, imageSrc, alt }) {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <StyledVehicleImg
        className={className}
        id={id}
        src={imageSrc}
        alt={alt}
      />
    </motion.div>
  );
}

export default VehicleImg;
